import React from "react";
import Expanded from "./Assets/ExpandedInsurence.jpg";
import { Container, Tab, Nav, Row, Col } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

class Profile extends React.Component {
  render() {
    return (
      <>
        <h1 className="profile_title">My Profile</h1>
        <section className="profile__items">
          <a className="profile__items--link" href="#about">
            About Me
          </a>
          <br />
          <a className="profile__items--link" href="#chosen_benefits">
            Chosen Benefits
          </a>
        </section>
        <section className="profile">
          <section className="profile__content">
            <div className="profile__content__about" id="about">
              <img
                src={Expanded}
                alt="profile-img"
                className="profile__content--img"
              />
              <h1 className="profile__content--name">Анатолий Карпов</h1>
              <h2 className="profile__content--count">Количество Бонусов:</h2>
            </div>

            <div className="profile__content__benefits" id="chosen_benefits">
              <h1 className="profile__content--chosen">Выбранные Льготы</h1>
            </div>
          </section>
        </section>
      </>
    );
  }
}

export default Profile;
